html, body {
  width: 100%;
  height: 100%;
  margin: 0px;
  padding: 0px;
}
html, body, #app {
  box-sizing: border-box;
  width: 100%;
  height: 100%;
  overflow: hidden;
}

//
import '@/style.css'
import App from '@/src/app.js'
import router from '@/router.js'

var app = new Vue({
  router,
  el: '#app-attach-point',
  components: {
    App
  },
  template: '<div id="app"><App /></div>'
})

export default app;

//
import Home from '@/src/pages/home.js'
import About from '@/src/pages/about.js'

const router = new VueRouter({
  mode: 'hash',
  routes: [
    {
      path: '/',
      component: Home
    },
    {
      path: '/about',
      component: About
    }
  ]
})

export default router
